"description": "Floral flask with wood print background.  \n\n...............................................................................................................................\n\nTHE DETAILS:\n\nBrand new stainless steel flask with screw top. \nSize:  6oz\nWaterproof sublimation design wraps all the way around the flask.\n\nGift options:\nYou can choose to have the flask only, or include a flask funnel for easy filling.\n\n...............................................................................................................................\n\nCUSTOM ORDER NAMES AND INITIALS: \n\nIf the flask you choose has a personalized name or initial/s, please write them in the notebox at checkout EXACTLY as you want them to be printed. Refunds/exchanges are not offered for customer mistakes in spelling. **Proofs are not sent for regular orders**\n\n**Failure to supply the correct information at checkout can result in delays for your order**\n\n..............................................................................................................................\n\nHOW WE DO IT:\n\nAll our flasks are made with a special high quality polymer wrap using permanent Dye Sublimation.  Our wraps are durable, waterproof, and have a scratch resistant gloss finish.  The design wraps all the way around the flask, slightly overlapping in the back. \n\nDye Sublimation, is the method of applying an image/graphic to specially coated ceramics, metals, polyester cloth, and polymers, using specialty sublimation inks,  sublimation printers, high heat, and pressure.  Sublimation ink is unique because it is converted from a solid to a gas without becoming a liquid. The conversion is initiated by heat and high pressure. The end result is a beautiful and durable work of art that will never fade.\n\n...............................................................................................................................\n\nSHIPPING:\n\nEvery flask is made to order, so please allow for up to 1-10 business days (Mon-Fri) before your order is shipped. \n\nU.S. Orders will ship USPS first class with tracking. The usual time frame for this is 3-5 business days.\n\nINTERNATIONAL orders will ship USPS First Class International.  Delivery varies from 10 days to 6 weeks depending on customs and location.\n*Please be aware there may be customs fees due when your package is delivered.  These fees are the customers responsibility, please know the rules for customs fees in your specific country.*  \n\n................................................................................................................................\n\nNeed a large quantity for Wedding Parties, Businesses, or other special events? No problem, just send me a convo, and we can create a custom order just for you.\n\n**Please keep in mind that every flask is handmade to order by me. I strive to make them as close to the actual listing as possible, but there may be slight variations from the photos shown. Also please allow for small variations in color due to the variances in monitor settings.**\n\nThanks for stopping by!",
