"title": "Custom mugs and liquor flasks.  Follow @SassAndSips",
"announcement": "High quality custom mugs and liquor flasks, handmade to order in the USA.\r\nEach mug is made to order using a permanent dye sublimation method.  The designs are dyed right into the mug resulting in vibrant colors that are permanent, and dishwasher safe.  I use the highest quality sublimation inks and mugs available.\r\n\r\nEach liquor flask is made with a special industrial quality polymer wrap, using a permanent dye sublimation method. We are the original creators of polymer wrapped flasks, and I have perfected my process, to give my customers the best quality flasks.  Flasks are durable, completely waterproof, beautifully made, and have a scratch resistant gloss finish. I do not use vinyl, paper, or messy sealants.  \r\n\r\nThank you so much for visiting my shop, supporting independent designers, and buying handmade items. I hope you enjoy what you see, and come back often. If you do not see what you are looking for, please feel free to convo me, and we can put together a custom order just for you.  \r\n\r\nThanks for stopping by!\r\nKaren ",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "Due to an unexpected surgery I will be unable to take any new orders for about a week. As soon as I get back on my feet, the shop will be open :) Thank you for your patience and understanding.",
"sale_message": "Thank you so much for your purchase, I will get started on your order right away, and I will let you know as soon as it ships.  If you have any questions please don&#39;t hesitate to ask. \r\n \r\nHave a spectacular day!\r\nKaren \r\n\r\n---------------------------------------------------------------------------------------\r\nGeneral Shipping Information:\r\nEvery item is made to order, so please allow for current production time before your order is shipped. \r\n\r\nU.S. Orders will ship USPS first class with tracking. The usual time frame for this is 3-5 business days.\r\n\r\nINTERNATIONAL orders will ship USPS First Class International. Tracking for this service is only available in select countries.  Delivery varies from 10 days to 8 weeks depending on customs and location, so please plan accordingly.\r\n*Please be aware there may be customs fees due when your package is delivered. These fees are the customers responsibility, please know the rules for customs fees in your specific country.*\r\n\r\n**I cannot guarantee that packages will not be damaged, or lost in the mail, but if such a situation should occur, please contact me so we can work to a resolution.**",
"digital_sale_message": null,
