"description": "We took our best Beard Oil formula and made it better!\n\nThis listing is for:\nOne 3-Ounce Amber Glass Bottle of Whiskey Scented Simply Great Beard Oil\n\nOur Whiskey Beard Oil is slightly sweet and old fashioned. Our most popular scent!\n\n..........................................................................................\n\nLooking for a Beard Oil + Beard Wash Combo?\n\nWe&#39;ve got you covered  &gt;&gt; http://etsy.me/1hta7WO\n..........................................................................................\n\nSimply Great Beard Oils are handmade from scratch recipes in small batches. We are a husband-and-wife small business located in beautiful New England creating unique artisan bath and body products. Our customers love the performance they get from our Beard Oil!\n\nWe use only the highest quality natural oils and keep low inventory to ensure the freshest product possible. Our Beard Oil has been tried and true for years and we&#39;re excited to bring this new brand to our fellow Etsians.\n\nWe use the hair softening power of nut and Wheat oils along with natural Rosemary oil to coat beard hairs and naturally soften them without using heavy waxes, pomades or otherwise strange products. It&#39;s fast absorbing and you only need a bit on the tips of fingers to get results. \n\nINGREDIENTS: OLIVE OIL//HAZELNUT OIL//SWEET ALMOND OIL//WHEAT GERM OIL//FRAGRANCE//ROSEMARY OIL//MIXED TOCOPHEROLS.\n\n3 oz | 89 mL\n98.5% NATURAL\n\nWe do use fragrance oils. If you would prefer an Unscented, please head here: http://etsy.me/1htaEYJ\n\nWe can also discuss essential oil blends for a custom product as well.\n\n***********************************************************\n\nWARNING: CONTAINS NUT/TREE NUT OILS. KEEP OUT OF REACH OF CHILDREN. NOT FOR CONSUMPTION OR INTERNAL USE. DO NOT USE ON OPEN WOUNDS. DISCONTINUE USE IF IRRITATION OCCURS. DO NOT STORE IN HOT OR HUMID CONDITIONS.",
