"title": "1950’s Short Shot - Pony Shot Whiskey or Kitchen Shot Glass of Barber Shop Quartet by Libbey",
"description": "This short shot glass is decorated with a barbershop quartet and say 1 oz. on them. It was made by Libbey Glass. It measures 2” inches in diameter and 2 ¼” inches high.\n\nIn excellent condition.\n\nA shot glass’ normal size is 1.5 oz.  &quot;Short shot&quot; glasses or &quot;pony shots&quot; are 1 ounce.\nIn bartending, a &quot;shot glass&quot; is usually 1.5 ounces, but sometimes 2 ounces with a measuring line at 1.5 ounces. You can also buy (in US) &quot;short shot&quot; glasses or &quot;pony shots&quot; which are 1 ounce. Pony shots are usually used with Martinis, Manhattans, and Rob Roys.\n\nMost shot glasses are found in the United States, but shot glasses from before the 1940s are very rare.\n\nBefore Prohibition in the U.S. in the early-to-mid-1900s, thin-sided whiskey glasses were common. After Prohibition, these were replaced by shot glasses with a thick base and thick sides.\n\nShipped USPS First Class",
