"policy_welcome": "Welcome to Stone Effects! Located in Sykesville, MD \r\n\r\nWe offer a wide variety of Custom Engraved Stones, Signs, Etched Glass and Custom Vinyl Lettering & Graphics. We can engrave any word, thought, name, phrase or design that you choose. We are also able to add graphics or corporate logos to personalize your product. Whether you need a custom engraved stone, vinyl lettering or etched glass, your items in bulk or just a few, we can handle any size order. We create all of our items in house at our facility, unlike most companies who send their work out to a third party.\r\n\r\n In order for your custom item design to be of the highest quality our staff reviews your order each and every time. We make sure you will never be dissatisfied. Our business is based on customer service, fast turnarounds, and quality at an affordable price. We also enjoy hearing from our customers, and have tailored our products to meet your  needs. Please ask questions! As you browse our site, we are open to suggestions.\r\n\r\n Thank you for visiting with us! We look forward to working with you! \r\n\r\nwww.stone-effects.com \r\n\r\nLIKE US ON FACEBOOK\r\nhttp://www.facebook.com/StoneEffectsMD\r\n\r\n",
"policy_payment": "We accept Major Credit Cards and Etsy gift cards through Etsy&#39;s direct checkout. \r\n\r\nWe also accept credit card payments through PayPal. You do  NOT need a PayPal account  to use this quick and  easy  payment service. \r\n\r\n*** PLEASE NOTE :***  If you are paying with a eCheck we need to wait until your payment is cleared before we ship your items.  Echecks usually clear in 3- 5 days.\r\n\r\n If you should have any questions about your order or  processing  please message me or give us a  call. \r\n",
"policy_shipping": "We ship orders via USPS Priority Mail & First Class. We ship to the USA ONLY\r\nWe are not responsible for missing packages after delivery.\r\n ",
"policy_refunds": "Glassware-  We package our glassware as safe as we can but accidents do happen. If your glassware is damaged when you receive it you must let us know within 1 business day of receiving the package. A photo of the box and items are required for  replacement or a refund. ",
"policy_additional": "Most of our images can be etched or cut into most of the items we sell. \r\n\r\nWe do not offer gift wrapping but can add a special note to be included with your package. ",
"policy_seller_info": "Stone Effects\r\nSykesville, MD  21784\r\n(443) 277-0602\r\nwww.stone-effects.com \r\nLike us on facebook  www.facebook.com/StoneEffectsMD\r\nLaura@stone-effects.com \r\nstoneeffectsmd@aol.com ",
