"policy_welcome": "I have always been a fan of the arts from the time I was in elementary school to the present.  (1st Proud Moment - 2nd grade - I was awarded second place by famous painters Jamie & Andrew Wyeth for my sponge painted fall trees.  That&#39;s when I knew I loved art!)  \r\n\r\nI was an elementary school teacher for eleven years and taught kindergarten through third grade.  Then we moved around a lot and I stayed home with kids for a while. Later I went back to school for Graphic Design.  \r\n\r\nMy oldest daughter was married in October of 2011 and I put my Graphic Design skills to good use.  I created all of the wedding items, signs, and decorations for her special day.  During the wedding I received many compliments on the handmade items.  Later, my daughter suggested I open an ETSY shop to sell similar items to busy brides/grooms who do not have the time to create them.  So this past spring, my daughter helped me set up iDo by ksoldo and now I can proudly say I own my own business!\r\n\r\nMy youngest daughters are heading to the United Kingdom to study at performing arts conservatories this fall, so I will have an &quot;empty nest&quot; for the first time in 26 years.  People ask me what I am going to do with all my extra time and I can confidently say....develop my ETSY business...and skype a lot (I will miss my girls)!",
"policy_payment": "I accept PAYPAL payments only.  ",
"policy_shipping": "I use USPS Priority mail for items that require shipping. (Delivery in 2 - 3 business days.)  Items, such as PDF files, are e-mailed so there is no shipping charge.",
"policy_refunds": "It is my goal to make you 100% satisfied with your purchase.  If you encounter any problems, please message me and I will correct the issue.  I do not accept returns.",
"policy_additional": "Please feel free to email or message me with any questions or special requests.  I will answer quickly and LOVE to make new things that will be perfect for your wedding or special event.  You can message me here on ETSY or e-mail: kim.soldo@yahoo.com\r\n\r\nFavorite Quote: &quot;Quality is not an act, it is a habit.&quot; Aristotle\r\n\r\nFor this reason, everything I make, I create as if I were making it for my own son or daughter or my own best friend.\r\n\r\n",
