"title": "The Gent Beard Oil - Whiskey-inspired scent",
"description": "Scent: very warm, rich, woodsy, with a hint of citrus and smooth vanilla finish\nScent Strength: medium\nTherapeutic Essential Oil Benefits: antidepressant, eases anxiety and improves self-confidence, stimulating\n\nKey Benefits: Can help fight SAD or Seasonal Affective Disorder. Can help improve skin elasticity and moisturization, and is good for those who suffer from eczema or psoriasis.\n\nFor the man who likes to end his day with a few fingers of whiskey and a good cigar. This beard oil is for the gent&#39;s beard. It&#39;s classy, with strong notes of smoke and vanilla, and high notes of flora and citrus.\n\nThe signature scent&#39;s inspiration comes from a good strong glass of whiskey, taking notes from popular bourbons and ryes, that often have strong spice and oak notes, mixed with a smoky undertone and high citrus flavors. And thus, after much research (in which much whiskey was consumed), The Gent was born.\n\nNOTE: There is no alcohol in the beard oil. It is only scented with inspiration from the flavors of fine whiskey.\n\n---\n\nThe ingredients are all natural, with only beneficial properties. There are no fragrances; only natural essential oils. This helps prevent skin irritation.\n\nThis beard oil works hard on your beard and your face. What you put on your beard ultimately works its way to your skin, which is exactly what this oil is meant to do. The base of the beard oil also has carefully-chosen carrier oils, sweet almond oil, avocado oil, and argan oil, that are known for helping encourage healthy appearance, while moisturizing both the beard and the skin underneath.\n\nThe oil can help new beard-growers deal with that itchy stage, while it&#39;ll help keep the beard soft and handsome as it grows and is maintained, as well.\n\n100% all natural ingredients. Non-comedogenic. Gluten free. Non-toxic. Fragrance free.\n\nComes in a 1oz amber glass bottle with a dropper for easy application, or 1/4 oz vial for sampling.\n\nA little about essential oils and the beard oils’ scents:\nIf scents and fragrances often give you headaches, you have nothing to worry about here! What causes migraines are fragrance oils, which are usually filled with chemicals that are oftentimes neurotoxins. My scents are 100% natural, created from combinations of therapeutic essential oils, which often can help with headaches, rather than cause them.",
