"title": "Whiskey, Ink, & Lace | Handcrafted bath & body goods",
"announcement": "A collection of bath & body goods with rustic americana flair that will treat your everyday life to a li&#39;l handcrafted lovin&#39;.\r\n\r\nWe are a very small, dedicated team all working very hard to bring you great, all natural products. All of our items are handcrafted by a small, dedicated team, and we receive a huge number of orders daily. A lot of love goes into every order, and that takes time. \r\n\r\nOur processing time right now is 1-10 business days. Thanks so much for your patience!\r\n\r\nWe do sell wholesale, so if you have a shop, salon, or boutique and are interested in carrying Whiskey, Ink, & Lace products, please checkout http://whiskeyinkandlacewholesale.com.\r\n\r\nWe also often do trades with other handcrafters, so if you own an Etsy store, feel free to ask!\r\n\r\nWe do not currently have a retail space in Seattle, but we do offer will call! Our will call hours are by appointment only between 9a-3p M-F. Please contact us in advance to set up a will call order.\r\n\r\nIf you&#39;d like more information about the nitty gritty details behind the ingredients we use and why we choose them, check it out here: http://whiskeyinkandlace.com/nitty-gritty/\r\n\r\nDon&#39;t forget to like and follow Whiskey, Ink, & Lace on Instagram, Facebook and Twitter!\r\nhttp://instagram.com/whiskeyinkandlace\r\nhttp://facebook.com/whiskeyinkandlace\r\nhttp://twitter.com/whiskeyinklace",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "We have to temporarily shut down our store in order to catch up with holiday orders. WE ARE NOT ACTUALLY ON VACATION. We are working so very hard to get caught up and get everything out in time for the holidays! Thanks so much for understanding and for your patience!\r\n\r\nPLEASE NOTE: We are not able to guarantee that international orders will arrive in time for the holidays. At this time, we are also NOT able to guarantee that any orders, domestic or international, that are placed after Dec 2nd will arrive in time for the holidays. But we are doing our very best and working so hard to get orders out on time!\r\n\r\nWe are a very small, dedicated team all working very hard to bring you great, all natural products. We&#39;ve adjusted our shipping times to reflect the holiday season. All of our items are handcrafted by a small, dedicated team, and we receive a huge number of orders daily. A lot of love goes into every order, and that takes time. Thanks so much for your patience!\r\n\r\nRight now our processing times are 1-10 business days for orders of 1-2 items, and 3-14 business days for orders of 3 or more items.\r\n\r\nIf you&#39;d like more information about the nitty gritty details behind the ingredients we use and why we choose them, check it out here: http://whiskeyinkandlace.com/nitty-gritty/\r\n\r\nDon&#39;t forget to like and follow Whiskey, Ink, & Lace on Facebook and Twitter!\r\nhttp://facebook.com/whiskeyinkandlace\r\nhttp://twitter.com/whiskeyinklace",
"sale_message": "Thank you for shopping with Whiskey, Ink, & Lace!\r\n\r\nWe are a very small, dedicated team all working very hard to bring you great, all natural products. All of our items are handcrafted by a small, dedicated team, and we receive a huge number of orders daily. A lot of love goes into every order, and that takes time. \r\n\r\nOur processing time right now is 1-10 business days. Thanks so much for your patience!\r\n\r\nIf you have any questions or concerns, please email us at whiskey@whiskeyinkandlace.com.\r\nCheers!\r\nAndi a.k.a. Whiskey\r\n\r\nP.S. Don&#39;t forget to like and follow Whiskey, Ink, & Lace on Instagram, Facebook and Twitter!\r\nhttp://instagram.com/whiskeyinkandlace\r\nhttp://facebook.com/whiskeyinkandlace\r\nhttp://twitter.com/whiskeyinklace",
"digital_sale_message": null,
