"policy_welcome": null,
"policy_payment": null,
"policy_shipping": "Since all orders are handcrafted and made-to-order and the packaging is handcrafted, please allow for a few days’ processing time for your order to get out. A lot of love goes into the handcrafting of each order, and that doesn’t happen immediately. Thanks for your patience!\r\nGeneral Shipping Policies\r\n\r\nShipping is determined on a product by product basis. Most items are processed and shipped within 1-10 business  days of an order from Seattle, Washington. Larger orders that are boxes/kits or contain 3 or more items will typically take 3-14 business days to ship. Some orders will take longer because of the nature of the item purchased. \r\n\r\nProcessing time is separate from shipping time. Processing time is how long it takes to make and label and pack your order, and shipping time is the time in which your order will be in transit to you. \r\n\r\nWe try to provide tracking information for all packages. If you have a concern or question about an item that you purchased and are awaiting its arrival, let us know.\r\nWe are not responsible for any duties collected on international orders. We have no control of customs holds the package and delays or prevents delivery.\r\n\r\nPlease be certain all shipping information is correct BEFORE clicking ”Confirm Payment.” Whiskey, Ink, & Lace is not responsible for packages lost due to incorrect shipping information.\r\n\r\nOther Shipping\r\n\r\nWe do not currently have a retail space in Seattle, but we do offer will call! Our will call hours are by appointment only between 9a-3p M-F. Please contact us in advance to set up a will call order.\r\n\r\nInternational customers: please let us know if you have any problems with shipping options at checkout. We will help you as quickly as possible to remedy the problem.\r\nInternational orders may take longer to arrive. Customs may delay delivery which is beyond our control.\r\n\r\nBuyer is responsible for any imposed duties on order.\r\n\r\nPlease check the USPS website for their schedule of Holiday Dates For Domestic Mail. Their deadline for first class mail is December 20th. However, there’s no guarantee that orders made on December 18th or 19th will be dropped off at the post office by December 20th. Get at us with any questions!\r\n\r\n\r\nTaxes\r\n\r\nNothing is sure, but death and taxes, eh? If you reside in Washington state like us, you’ll be charged a tax rate based on your location within the state at checkout. Otherwise, you’re off the hook!",
"policy_refunds": "Returns Policy\r\n\r\nYou may return new items items within 14 days of delivery for a full refund. If the return is a result of our error (you received an incorrect item), we will pay for the return shipping.\r\n\r\nYou should expect to receive your refund within four weeks of receiving refund authorization from us, however, in many cases you will receive a refund more quickly. This time period includes the transit time for us to receive your return from the shipper (5 to 10 business days) if you return the item, the time it takes us to process your return once we receive it (3 to 5 business days), and the time it takes your bank to process our refund request (5 to 10 business days).\r\n\r\nWe cannot offer exchanges just because it makes it easy to create errors in our system. We can, however, provide you with store credit if you&#39;re interested.\r\n\r\nPLEASE NOTE\r\n\r\nRefunds and credits for returned merchandise will be issued only for unused products returned in its original packaging if a return is authorized. If used, it contaminates the raw product and we are unable to use it appropriately. We do not accept returns for &quot;clearance&quot; items, samples, clothing, or mugs. We are unable to accept returns for international orders.\r\n\r\nAll shipping charges become the sole responsibility of the customer, unless it is the error of Whiskey, Ink, & Lace. All returns must be postmarked within 30 days of the invoice date to qualify for a return. Refused or non-deliverable packages will be canceled upon receipt and will be subject to a return shipping fee by the carrier.\r\n\r\nPlease do not return products that do not meet the return criteria listed above, as we will not be able to issue refunds for non-qualifying items and cannot return the items to you. ",
"policy_additional": "Preservatives\r\n\r\nFor the safety of the end consumer, I do use preservatives to fight bacteria growth. However, I have very carefully researched over a long amount of time to find all natural, paraben and formaldehyde free preservatives, to best protect the health of my customers. You can read about the preservatives I use here:\r\nhttp://www.organic-creations.com/servlet/the-3694/naturally-derived-preservative/Detail",
