"title": "The New Yorker magazine July 10, 1989",
"description": "The New Yorker debuted on February 21, 1925.  The non-fiction feature articles (which usually make up the bulk of the magazine&#39;s content) cover an eclectic array of topics. The magazine is notable for its editorial traditions and famous cover art. Enjoy the crisp cover. Remove the cover and frame it, or read and enjoy the entire magazine over and over again. Complete your collection perhaps? \n\nThis July 10, 1989 features the article, “The City Gone Psycho”, by Pauline Kael.” Cover art is by Jenni Oliver. \n\nThis magazine is in its original shipping plastic. There is no shipping label on the document or the packaging. It has not been opened or internally examined. It may not be in perfect condition since it has traveled through the mail. Additionally it is a quarter century old and the paper may have degraded minimally. It does however appear to be in exceptional collectible condition unless otherwise noted. \n\nA note about shipping: I try to save you costs by shipping the most inexpensive way possible. This magazine will ship in a brown business envelope with no extra packaging. If you want it shipped with extra packaging or in a different manner, please start a conversation with me, and I will be happy to try and coordinate it with you.",
