"title": "Whiskey Cream Organic Lollipops Liquor All Natural Gourmet Gifts Favors Party Ideas",
"description": "We experimented with batch after batch of whiskey cream pops in order to achieve the perfect balance between whiskey, sugar, vanilla and cream in order to bring you these unusual, highly addictive pops.   Creamy and sweet with smokey whiskey undertones but without that stinging bite — 99% of the alcohol burns off leaving nothing but flavor and goodness behind.  in taste tests, even some of whiskey&#39;s most ardent naysayers have fallen in love them. Amen, sistah! \n\n*5 standard sized pops per package.\n\n*Ingredients: Organic vegan sugar, organic non-GMO corn syrup, organic whole cream, Jim Beam whiskey, whiskey extract, organic Madagascar vanilla extract.\n\n\nOur Eco-Freindly Promise:\n\nAll pops are made in responsible ceramic ‘green pans.’  Green pans are lead, cadmium, Teflon, and PFOA free.  We do not use aluminum and work on unbleached, chlorine free FSC certified parchment papers.\n\nOur shipping materials consist of recycled biodegradable cardboard, recycled paper shreds, and unbleached, petroleum and chlorine free recyclable snack bags made from 100% renewable resources. Our waxed bags (when we use them) are soy free, unbleached, and made from natural Parrafin wax; they are landfill safe and will not degrade and contaminate groundwater.  Our lollipop wrappers are from Nature Flex™ and are Cello bags made from wood cellulose fibers sourced with sustainable forestry principles. They are certified biodegradable, compostable and made carbon zero. Meets ASTM D6400, EN13432 standards for CA and other states. Finally, our ribbons are made from cotton yarn that is grown and dyed responsibly in the USA. Ribbon is acid and lignin free. Soy based inks are used when ribbon is printed. Ribbon is also compliant with California Proposition 65. \n\nPops vary in color from light amber to a rich brown, depending on the ingredients.  This is a GOOD thing.  We never use artificial colorants, which means what you see is what you get.  All sugar caramelizes to some degree when heated, imparting a nice toasty color.  There are a few all-natural colorants (very few), but generally, if your pop is colored, white, almost white, or crystal clear it usually means bleached sugar or additives were used in the process.  Colored pops are pretty, but we have no problem sacrificing looks for kick-ass, unbeatable flavors and taste.  I mean, you’re eating them, right, not wearing them on your neck (besides, our pops are pretty nice to look at anyway).\n\nIn that vein, we sometime pour our pops freestyle and sometimes use molds, though we prefer pouring freestyle.  Hand poured freestyle pops can be very organic looking and sculptural (which we love).  Molded pops are perfectly round — generally they are all the same size and weight.  There really is no rhyme or reason to which we choose though, so if YOU have a preference, please let us know and we&#39;ll happily oblige.",
