"description": "Clever gift for the Groom from the Bride--just in case he gets the slightest shiver!  These whiskey labels will warm him up--no excuses.\n\nThis listing is for:\nSet of TWO (2) labels (Yellow or Black style)\n\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\nTO CUSTOMIZE YOUR LABELS\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\nAt checkout, please include the following in the NOTES TO STUDIOBLABELS:\n\n1. Name of GROOM\n2. Grooms INITIALS (in order of First Last Middle) if Black label selected\n\n- Labels will be similar layouts as shown in photos. Unless specifically requested, I&#39;ll use my best judgement as to whether first and last or just first name looks best\n- This label can be customized for the ladies as well!\n\nLabels are printed 2 to a sheet and the price is the same for 2 or less.\nNeed more than 2? Purchase extra labels here:\nhttps://www.etsy.com/listing/125412555/custom-additional-labels-reserved-for\n\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\nABOUT THESE LABELS\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\nThese labels come in a set of 2 (TWO), professionally printed on weatherproof semi-gloss stock.  Each individual label measures 3.3” wide x 4” tall.\n\nYELLOW LABEL - Fits 375 ML labels (flask style bottle as seen in actual customer photo #4)\nThis label also fits the large 750ML bottle however the label is slightly smaller than the original (customer photo #5)\n\nBLACK LABEL -  Fits 750ML bottle only\n\nThese labels read:\nCOLD FEET\nSERUM\nGROOM NAME\nCHEERS TO THE GROOM\nFROM YOUR LOVING BRIDE\n\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\nSHIPPING\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\nUS STANDARD: Typically 6-8 business days to your door from placing order\nPRIORITY: Typically 5-6 business days to your door from placing order\nRUSH: Next day turnaround with PRIORITY shipping. Typically 3-4 business days to your door. \nEXPRESS: Next day turnaround with EXPRESS shipping. Typically overnight or 2nd day service (varies on location) and is the only shipping option that is guaranteed by USPS. \n\nA tracking number will be sent upon shipment and details regarding your shipping date can be viewed on your &quot;Purchases&quot; page. For additional shipping information, including international shipping times, please see Shipping Section on shop Policies Page.  USPS does experience rerouting and delays from time to time. Standard International delivery is typically 2-3 weeks.  Need this order RUSHED??! Purchase expedited printing and shipping from the drop down at check out!\n\nEach line can be customized as requested based on fitting. Custom requests must be made IN CAPS in a separate sentence with as much detail as possible.\n\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\nOTHER IMPORTANT INFO\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\nThe original labels definitely look best removed and it’s pretty simple to do!  A very thorough set of instructions are included with each order.\n\nWhiskey and bottle are not included. :)\n\nA gift soon not forgotten! Happy Wedding!",
