"title": "Buy Stainless Steel Hip Flasks Online",
"announcement": "!!!Ask us about our Superhero inspired flask designs!!! \r\nWe print our flasks on professional grade vinyl. \r\n\r\nHip flasks are the perfect gift for a stocking stuffer, wedding, bridal party, bachelorette party, birthday present, retirement, new years, sorority, secret santa, employees or for yourself.\r\n\r\nStainless steel 6oz hip flask by Lady Rene\r\n★ Hip & Stylish Gift for under $25\r\n★ Fits conveniently in purse or pocket\r\n★ Durable, water and fade resistant.\r\n★ Order as many flasks as you want for only $5.95 shipping (USA only)\r\n★ Add a funnel to your order! Click Here - https://www.etsy.com/listing/78180589/stainless-steel-flask-funnel-with-ball?ref=shop_home_feat_1\r\n\r\n\r\nTake a look and support these wonderful shops that sell Lady Rene flasks!\r\nSupport local businesses!!\r\n- Paperish Mess: paperishmess.com\r\n- Co-op 28 Handmade: Los Angeles www.facebook.com/Coop28handmade‎\r\n- Sacred Art - Chicago: \r\nhttp://www.facebook.com/SacredArtChicago • www.sacredartstore.com\r\n- Re-Invent - Chicago: https://www.facebook.com/ReInventstudio",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Thank you for your flask order from Lady Rene!\r\n\r\nAll flasks are &quot;Made to Order&quot;. You will receive a shipping notification by email when your package leaves for the postal service. Have a concern, question or request? Please contact Miranda right away at mirandarowe@ladyrene.com or through the website.\r\n\r\n★★★ Please check the homepage for special shop announcements! \r\n\r\n★★★ If you have made special arrangements with us concerning your order, please know that your order will ship in a timely manner as agreed upon. \r\n\r\n★★★ Orders process in 3-5 business days (Mon - Fri)  (Shipping time additional). Please note that holiday rush may extend the processing time. If you have a rush order please put your deadline in the note box and we will do our best to get your order out as quickly as possible.\r\n\r\n★★★ USA SHIPMENTS: Your flask order may ship by either USPS Priority Mail (2-3 business days) or First Class (continental U.S. 2-5 days for delivery).\r\n\r\n★★★ INTERNATIONAL SHIPMENTS: Please allow 3 or more weeks for delivery. In some instances your package may arrive quicker within 10 or more business days depending on destination. Package will be shipped by First Class Mail International. Please allow adequate shipping time for your order to arrive. We cannot guarantee arrival by a specific time. Customs may cause significant delays. Any customs fees are the responsibility of the customer.\r\n\r\n★★★ Express shipping is available by request for an additional fee.",
"digital_sale_message": null,
"last_updated_tsz": 1445811801,
"listing_active_count": 66,
"login_name": "LadyRene",
"accepts_custom_requests": true,
"policy_welcome": "Welcome and thank you for visiting LadyRene.\r\n\r\nAll flasks are made to order! Please allow 2-5 business days for your order to process, custom order could take longer. Most orders ship via USPS Priority Mail or First Class in the U.S. with delivery in 2-5 business days. Need a RUSH ORDER? Please contact me right away! (Expedited shipping is available)\r\n\r\nINTERNATIONAL SHIPMENTS:\r\nIMPORTANT: Customs may cause significant delays. Please allow at least 3 weeks for your order to arrive.\r\nOrders are shipped via USPS Priority Mail International or First Class International. ",
"policy_payment": "PAYMENT:\r\nImmediate payment is accepted by PayPal or Credit Card.\r\n7% Sales Tax applies to South Carolina orders.",
"policy_shipping": "★ EXPRESS MAIL\r\nIf you require expedited shipment by a specific date please let us know right away!!! We will supply you with a shipping quote for a faster shipping method. Please tell us your location and zip.\r\n\r\n★ SHIPPING INFORMATION -\r\n• Entire order ships for only $5.95 in the USA. \r\n• All flasks are Made to Order. (Customize w/ monogram or name, color change, etc.)\r\n• Orders ship by USPS\r\n\r\n★ INTERNATIONAL SHIPMENTS -\r\nIMPORTANT: Customs may cause significant delays. Please allow at least 3 or more weeks for your order to arrive depending on destination. Destination Duties, Taxes, & Import Charges are buyers responsibility. \r\n\r\n*Subject to change without notice.",
"policy_refunds": "RETURNS:\r\nIf you are unhappy for any reason, notify Lady Rene and we will gladly exchange or refund your money less any delivery charges.\r\n\r\n• Custom Order: Items are FINAL SALE, and we will only accept returns on special orders in the event of a mistake on our part or damage to the product.\r\n\r\nDAMAGED SHIPMENT:\r\nDamaged merchandise may be returned for a replacement. You may be required to return the item or take photos of the damage. In the event that a replacement is not available the purchase price will be refunded. Please send email with your name, order # and a brief description of the damaged item or items being returned. Return shipping is nonrefundable.",
